import React from 'react'

const UpdateStudentProfile = props => {
    return (
        <form>
            <label>Update your profile</label>
            <input type="text" placeholder={props.firstname}/>
            <input type="text" placeholder={props.lastname}/>
            <input type="date" placeholder={<DateHandler obtainedTimestamp={props.user.dateOfBirth} />}/>
            <input type="text" placeholder={props.email}/>
        </form>
    )
}

export default UpdateStudentProfile
